Delete and return document in nested array with mongodb c# driver<p>I'm having trouble deleting an document in an array using the offical mongodb c# driver. What i'm trying to do is also return the document that was deleted.</p>
<p>Here's what my class looks like:</p>
<pre class="lang-cs prettyprint-override"><code>public class Holder
{
    public string Owner { get; set; }
    public List&lt;Card&gt; Cards { get; set; }
}

public class Card
{
    public string Id { get; set; }
    public string Name { get; set; }
    public string Placement { get; set; }
}
</code></pre>
<p>And here is an exerpt of the document:</p>
<pre class="lang-json prettyprint-override"><code>{
  &quot;owner&quot;: &quot;656dd33e0300&quot;
  &quot;cards&quot; : [
    {
      &quot;id&quot;: &quot;s39CNzu4Na3&quot;,
      &quot;name&quot; : &quot;Department&quot;,
      &quot;placement&quot; : &quot;8a&quot;
    },
    ...
  ]
}
</code></pre>
<p>My first thought was to just get the card and then delete it using the following:</p>
<pre class="lang-cs prettyprint-override"><code>var filter = Builders&lt;Card&gt;.Filter.Eq(x =&gt; x.Id, cardId);

var res = await collection.DeleteOneAsync(
     Builders&lt;Holder&gt;.Filter.Eq(e =&gt; e.Owner, owner) &amp;
     Builders&lt;Holder&gt;.Filter.ElemMatch(e =&gt; e.Cards, filter)
    );
try {            
    return res.DeletedCount &gt; 0;
}
catch (Exception ex) {
    throw;
}
</code></pre>
<p>But that just ended up deleting all the cards in the list.
I've been trying to use <code>FindOneAndDeleteAsync</code> but i can't get it to work.</p>
<p><strong>Update</strong>
First a big thanks to both @markus and @yongshun as both their answers worked for me, i have picked @markus as the answer because it was the first answer that worked and i like the shorter code that is similar the rest of my code.</p>

