Issue in API Calling with Routes<p>Can anyone solve my issue. I am working on a project where the ESP needs to call an URL and make a continuous connection using Web Socket to share the data. I made Routes for that and I used that in index.js but I am encountering some issue while calling that route.</p>
<pre><code>// ./Routes/data.js
const express = require('express');
const router = express.Router();

// WebSocket endpoint for updating electricity usage data
router.post('/update', async (req, res) =&gt; {

      // Your code to handle the POST request
      const { userId } = req.query;
      const { message } = req.body;
      console.log(`Received message &quot;${message}&quot; for user ID: ${userId}`);

      // Your logic to process the data...

      res.status(200).send('Data received successfully');
});

module.exports = router;


// ./index.js
const connectToMongo = require('./db');
const cors = require('cors')
const express = require('express')
const WebSocket = require('ws');

const updateDataRoute = require('./Routes/data');


connectToMongo();

const app = express()
const port = 5000


app.use(cors())

app.use(express.json());

//Available Routes
app.use('/api/auth', require('./Routes/auth'));
app.use('/update', updateDataRoute);

const server = app.listen(port, () =&gt; {
      console.log(`smartMeter - BackEnd listening on http://127.0.0.1:${port}`)
});

const wss = new WebSocket.Server({ server });

wss.on('connection', (ws) =&gt; {
      ws.on('message', (message) =&gt; {
            console.log('Received Message:', message);
      });
      ws.send(&quot;Connected to WebSocket&quot;)
})
</code></pre>
<p>When I am sending POST request to &quot;http://localhost:5000/update&quot; with a JSON in body {&quot;message&quot;:&quot;Hello&quot;,&quot;userId&quot;:&quot;123&quot;} from query I am getting this error. How to fix this.</p>
<pre><code>&lt;!DOCTYPE html&gt;
&lt;html lang=&quot;en&quot;&gt;
  &lt;head&gt;
    &lt;meta charset=&quot;utf-8&quot;&gt;
    &lt;title&gt;Error&lt;/title&gt;
  &lt;/head&gt;
  &lt;body&gt;
    &lt;pre&gt;Cannot POST /update&lt;/pre&gt;
  &lt;/body&gt;
&lt;/html&gt;

</code></pre>
