Timezone offset being doubled on my local machine but working fine on UTC server. Why?<p>I'm creating a new <code>event</code> on my local machine for my local db and my timezone offset is being duplicated by the server...</p>
<p>When a user of my app creates an <code>event</code>, the client-side scripting calculates and <em>adds</em> the TZ offset to the input before sending the offset time to the server. You can see this in my <code>req.body</code> below after selecting a 9am CST start and 10am CST end (current CST offset is 6hrs).</p>
<p>It looks perfect:</p>
<pre><code>req.body  {
  event_name: '9am start from local machine to local db',
  description: 'Testing the timezone offset',
  type: 'mens basketball',
  event_start: '2023-12-13T15:00',  // 09:00 + 06:00 = 15:00
  event_end: '2023-12-13T16:00',    // 10:00 + 06:00 = 16:00
  location_name: 'Home',
  address: '111 West Ave, Austin, TX 78703'
}
</code></pre>
<p>This is logged from the <code>createEvent</code> function on the server side:</p>
<pre><code>module.exports.createEvent = async (req, res) =&gt; {
    console.log(&quot;req.body &quot;, req.body);   // req.body from above

    try {
        // if req.body.address is blank, prevent event.geometry from being set
        const geoData = await geocoder.forwardGeocode({
            query: req.body.address,
            limit: 1
        }).send()
        const event = new Event(req.body);
        if (req.body.address === '') {
            event.geometry.type = 'Point';
            event.geometry.coordinates = [0, 0];
        } else {
            event.geometry = geoData.body.features[0].geometry;
        }

        event.user = req.user._id;

        console.log(&quot;event &quot;, event); // here, the start and end times have added 12 hours instead of 6

        await event.save();
        req.flash('success', 'Successfully made a new event!');
        res.redirect(`/events/${event._id}/addimage`)
    } catch (e) {
        req.flash('error', e.message);
        res.redirect('new');
    }
}
</code></pre>
<p>As mentioned in the comments next to <code>console.log(&quot;event &quot;, event)</code>, my start and end times have somehow had an ADDITIONAL 6 hours added into the offset bringing the full offset to 12 hours. This can be seen in the <code>event</code> object logged in the console:</p>
<pre><code>event  {
  event_name: '9am start from local machine to local db',
  description: 'Testing the timezone offset',
  location_name: 'Home',
  address: '111 West Ave, Austin, TX 78703',
  geometry: { type: 'Point', coordinates: [ -97.727415, 30.33413 ] },
  event_start: 2023-12-13T21:00:00.000Z,  // 09:00 + 12:00 = 12:00
  event_end: 2023-12-13T22:00:00.000Z,    // 10:00 + 12:00 = 22:00
  type: 'mens basketball',
  activations: [],
  fans: [],
