Is it possible to compare and match fields within referenced documents in MongoDB<h1>I am trying implement Dynamic Searching in MongoDB with Referenced Documents</h1>
<blockquote>
<h3>Market Schema:</h3>
</blockquote>
<pre class="lang-js prettyprint-override"><code>const MarketSchema = new mongoose.schema({          
    marketName: String,          
    // ... rest of the fields  
}); 
</code></pre>
<blockquote>
<h3>Moderator Schema:</h3>
</blockquote>
<pre class="lang-js prettyprint-override"><code>const ModeratorSchema = new mongoose.Schema({
    name: String,
    username: String,
    // ... rest of the fields
});
</code></pre>
<p>Now the Document that I trying to work on</p>
<blockquote>
<h3>ModeratorToMarketMapping Schema:</h3>
</blockquote>
<pre class="lang-js prettyprint-override"><code>const ModeratorToMarketMappingSchema = new mongoose.Schema({
    moderatorId: {
        type: mongoose.Schema.Types.ObjectId,
        ref: &quot;User&quot;,
    },
    marketId: {
        type: mongoose.Schema.Types.ObjectId,
        ref: &quot;Market&quot;,
    },
    // ... rest of the fields
});
</code></pre>
<p>I want to either filter the data based on <code>marketName</code> of the market or based on <code>name or username</code> of the moderator using ModeratorToMarketMapping documents.</p>
<p>I want the result to something similar to that what the following queries will produce</p>
<p>if search by market</p>
<pre class="lang-sql prettyprint-override"><code>SELECT * 
FROM Users AS u
JOIN ModeratorToMarketMapping AS map ON  u.id = map.moderatorId 
JOIN Market AS m ON map.marketId = m.id
WHERE m.marketName LIKE '%${FILTER_VALUE}%'
</code></pre>
<p>if search by name/username</p>
<pre class="lang-sql prettyprint-override"><code>SELECT * 
FROM Users AS u 
JOIN ModeratorToMarketMapping AS map ON  u.id = map.moderatorId 
JOIN Market AS m ON map.marketId = m.id
WHERE u.name LIKE '%${FILTER_VALUE}%' OR u.username LIKE '%${FILTER_VALUE}%'
</code></pre>
<p>I have thought of two approaches</p>
<h3>1] Less efficient one but it works</h3>
<p>In this solution If I want to filter by market, then I first search the 'markets' from <code>Market Collection</code> and then get the <code>id's of moderator</code> from the <code>Mapping schema</code> and then populate the data accordingly, similarly if I want to search by name or username then I fetch the <code>moderators</code> first the then get the <code>id's of markets</code> from <code>Mapping schema</code> and then populate the data</p>
<p>Now It's evident that this is <code>not</code> a good approach and will definitely fail when the data to search through grows.</p>
<h3>2] Looks efficient but partially works</h3>
<p>so I searched for 2nd approach and I ended up with this but this doesn't work as I want it to work.</p>
<p>the code for the same is as follows</p>
<pre class="lang-js prettyprint-override"><code>    const { criteriaKey, filterValue } = req.query;

    let query = {};

    if (criteriaKey &amp;&amp; filterValue) {
        const regex = new RegExp(filterValue, &quot;i&quot;);

        if (criteriaKey === &quot;market&quot;) {
            query = { &quot;market.marketName&quot;: { $regex: regex } };
        } else if (criteriaKey === &quot;name&quot;) {
            query = {
                $or: [
                    { &quot;moderator.name&quot;: { $regex: regex } },
                    { &quot;moderator.username&quot;: { $regex: regex } },
                ],
            };
        }
    }

    const moderators = await ModeratorMarketMapping.aggregate([
        {
            $match: query,
        },
        {
            $lookup: {
                from: &quot;markets&quot;,
                localField: &quot;marketId&quot;,
                foreignField: &quot;_id&quot;,
                as: &quot;market&quot;,
            },
        },
        {
            $lookup: {
                from: &quot;users&quot;,
                localField: &quot;moderatorId&quot;,
                foreignField: &quot;_id&quot;,
                as: &quot;moderator&quot;,
            },
        },
        {
            $unwind: { path: &quot;$market&quot;, preserveNullAndEmptyArrays: true },
        },
        {
            $unwind: { path: &quot;$moderator&quot;, preserveNullAndEmptyArrays: true },
        },
    ]);
</code></pre>
<p>How to make the about code work or is there another better way to do this except switching to RDBMS</p>

